CONNECT NEGOCIO/123456;










-- =========================================
-- 03: ROLES DE USUARIO
-- =========================================

CONNECT SYSTEM/oracle;

alter session set "_ORACLE_SCRIPT"=TRUE;

CREATE ROLE USSERS;

GRANT ALL ON SALOGPDA_SIGAH.USUARIO TO USSERS;

-------------------------------------------------------------------------------------------------------------------------------------

alter session set "_ORACLE_SCRIPT"=TRUE;

CREATE ROLE BUSSINESS;

begin
    for t in (select DISTINCT TABLE_NAME from ALL_TAB_COLUMNS where owner='NEGOCIO') 
    loop   
        execute immediate 'GRANT SELECT,INSERT,UPDATE ON NEGOCIO.' || t.table_name || ' to BUSSINESS';    
    end loop;
end;

-------------------------------------------------------------------------------------------------------------------------------------
alter session set "_ORACLE_SCRIPT"=TRUE;

CREATE ROLE ADMINISTRADOR;

GRANT DBA TO ADMINISTRADOR WITH ADMIN OPTION;

